import ProductList from'./ProductList'
import React from 'react';


function App() {
  return (
    <div className="Product">
      
      <ProductList/>
      </div>
  );
};

function Product({imgSrc, name, price}) {
  return (
    <div className="child">
      <img src={imgSrc} alt={name} />
      <p>
        <strong>{name}</strong>
        <br />
        {price} դր/1կտ
        <br />
        <button className="btn">Գնել</button>
      </p>
    </div>
  );
}
  
  

export default Product;
